export const REGISTER = 'REGISTER';
export const USER_LOADED = 'REGISTER';

export function authRegister(token) {
  return {
    type: REGISTER,
    payload:token
  };
}

export function authentication(token) {
  return {
    type: USER_LOADED,
    payload:token
  };
}
